import React, { Fragment, FunctionComponent} from 'react';
import styled from "styled-components"
import './dice.css'

interface DiceProps {
    roll: number
}

const Dice = styled.div`
    padding: 4px;  
    background-color: tomato;  
    width: 104px;  
    height: 104px;  
    border-radius: 10%;
`


const DiceComponent: FunctionComponent<DiceProps> = ({roll}) => {

    return (<Fragment>
<span cssClass="dice dice-1" title="Dice 1"></span>
<span class="dice dice-2" title="Dice 2"></span>
<span class="dice dice-3" title="Dice 3"></span>
<span class="dice dice-4" title="Dice 4"></span>
<span class="dice dice-5" title="Dice 5"></span>
<span class="dice dice-6" title="Dice 6"></span></Fragment>
)}

export default DiceComponent;
